import React from 'react'
import styled from 'styled-components'
import { Header } from '../main-pages/header'
import { Margin36 } from '../component/styledComponent'
import { TermBox } from './termBox'
import { LocationText } from './text'

const Container = styled.div`
  width: 100%;
`
const Title = styled.text`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 18px;
  line-height: 18px;
  color: #000000;
`
const BodyContainer = styled.div`
  margin: 0 auto;
  width: 1280px;
  height: 800px;
`

export const Location = () => {
  return (
    <Container>
      <Header />
      <Margin36 />
      <BodyContainer>
        {LocationText.map((location, index) => {
          return <TermBox title={location.title} contents={location.contents} />
        })}
      </BodyContainer>
    </Container>
  )
}
